import React, { useState, useEffect } from 'react';
import axios from 'axios';
import Header from './Header';
import '../styles/Profile.css'; // Importovanje CSS fajla za stilizaciju

const Profile = () => {
  const [user, setUser] = useState(null);
  const [editMode, setEditMode] = useState(false); // Stanje za praćenje režima uređivanja

  useEffect(() => {
    fetchUserData();
  }, []);

  const fetchUserData = () => {
    const userEmail = localStorage.getItem('user');
    if (userEmail) {
      const email = JSON.parse(userEmail).email;
      axios.get(`http://localhost:5000/api/getUser?email=${email}`)
        .then(response => {
          setUser(response.data);
        })
        .catch(error => {
          console.error('Error fetching user data:', error);
        });
    }
  };

  const handleEdit = () => {
    setEditMode(true); // Uključivanje režima uređivanja
  };

  const handleSaveChanges = () => {
    setEditMode(false); // Isključivanje režima uređivanja
    // Implementirajte logiku za čuvanje promena na serveru ako je potrebno
  };

  return (
    <div>
      <Header />
      {user && (
        <div className="profile-container">
          <h2>Profil korisnika</h2>
          <table className="profile-table">
            <tbody>
              <tr>
                <td>Ime:</td>
                <td>{editMode ? <input type="text" value={user.FirstName} /> : user.FirstName}</td>
              </tr>
              <tr>
                <td>Prezime:</td>
                <td>{editMode ? <input type="text" value={user.LastName} /> : user.LastName}</td>
              </tr>
              <tr>
                <td>Email:</td>
                <td>{editMode ? <input type="text" value={user.Email} /> : user.Email}</td>
              </tr>
              <tr>
                <td>Adresa:</td>
                <td>{editMode ? <input type="text" value={user.Address} /> : user.Address}</td>
              </tr>
              <tr>
                <td>Grad:</td>
                <td>{editMode ? <input type="text" value={user.City} /> : user.City}</td>
              </tr>
              <tr>
                <td>Država:</td>
                <td>{editMode ? <input type="text" value={user.Country} /> : user.Country}</td>
              </tr>
              <tr>
                <td>Broj telefona:</td>
                <td>{editMode ? <input type="text" value={user.PhoneNumber} /> : user.PhoneNumber}</td>
              </tr>
              <tr>
                <td>Slika profila:</td>
                <td>{editMode ? <input type="text" value={user.ProfilePicture} /> : user.ProfilePicture}</td>
              </tr>
            </tbody>
          </table>
          {editMode ? (
            <button className="btn btn-primary" onClick={handleSaveChanges}>Sačuvaj promene</button>
          ) : (
            <button className="btn btn-secondary" onClick={handleEdit}>Uredi</button>
          )}
        </div>
      )}
    </div>
  );
};

export default Profile;
